import React from 'react'
import TodoItem from './components/TodoItem'

export const TodoList = () => {

  const todos = ["buy apple juice", "practice React", "eat lunch"]

  return (
    <div>
      <ol>
        <li>One fish</li>
        <li>Two fish</li>
        <li>Red fish</li>
        <li>Blue fish</li>
      </ol>
      {todos.map(item => <TodoItem item={item}/>)}
    </div>
  )
}
